import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import './index.css';
import './images/2923.jpg';
import Navbar from './components/Navbar';

class App extends Component {
  render() {
    return (
      <div className="App">
        
        <head>
            <title>Bad Days: Home Page</title>
            <link rel="stylesheet" href="./index.css" type="text/css" />
        </head>
        <div class="navBar">
            <a href="index.html">Home</a>
            <a href="report.html">Statistics</a>
            <a id="register" href="register.html">Login/Signup</a>
        </div>
      </div>
    );
  }
}

function nav() {
  return (
    <Navbar />
  );
}

export default App;
